import React from "react";
import "./signUp.css";
function SignUp() {
  return (
    <div className="signup">
      <span className="heading">This Project for Guvi Assienment</span>
      <span className=" heading emailtxt">Enter the email</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Email"
        name="email"
      />
      <span className=" heading emailtxt">Enter the Password</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Password"
        name="email"
      />
            <span className=" heading emailtxt">If You Have Already Account Please <a href="">Login</a>   </span>

    </div>
  );
}

export default SignUp;
